import { ESelect, TItemsData } from "./type";

export const EducationalData: TItemsData[] = [
  {
    id: 1,
    value: ESelect.SUBSCRIPTION,
  },
  {
    id: 2,
    value: ESelect.NOT_SUBSCRIPTION,
  },
  {
    id: 3,
    value: ESelect.OTHER,
  },
];
